"<div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\nEi ole k\u00e4ytett\u00e4viss\u00e4 syntyneiden tietoja tai lastenkirjoja joista etsi\u00e4.<br />\nK\u00e4yd\u00e4\u00e4n l\u00e4pi rippikirjaa 1749-1759 jossa pit\u00e4isi olla merkittyn\u00e4 9-19 vuotiaana<br />\n- Aloitettu Lisas s. 70 <br />\n- \u00d6hlstans torp s. 55 ?<br />\n- Hindh\u00e5r Caus ?<br />\n- Ei l\u00f6ydy Norrweckoski<br />\n- Ei l\u00f6ydy Andersb\u00f6le<br />\n- Ei l\u00f6ydy S\u00f6derweckoski<br />\n- Michelsb\u00f6le Snickars?<br />\n- Ei l\u00f6ydy Kullo<br />\n- Swartz\u00e5 K\u00e5skos?<br />\n- Eriksdahl Grind 157/Ekn\u00e4s g\u00e5rd 158?<br />\n- K\u00e4yty t\u00e4h\u00e4n asti Illby s. 166\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
