"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nCarl Gustafsson Stjernberg on syntynyt 27/7 1847.<br />\nRippikirjoissa syntym\u00e4p\u00e4iv\u00e4n\u00e4 on 2/10.<br />\nV\u00e4\u00e4r\u00e4 syntym\u00e4p\u00e4iv\u00e4 on todenn\u00e4k\u00f6isesti kopioitu v\u00e4\u00e4rin lastenkirjasta rippikirjaan.<br />\nSeuraavalla rivill\u00e4 lastenkirjassa on ollut nuorempi sisko jonka syntym\u00e4p\u00e4iv\u00e4 on 2/10<br />\nPorvoo syntyneist\u00e4 ei l\u00f6ytynyt 2/10 Carl Gustafssonia.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
