"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSyntym\u00e4p\u00e4iv\u00e4st\u00e4 on pudonnut jossain siirrossa kirjasta toiseen kuukaudesta 1 pois, <br />\nja joulukuu on muuttunut helmikuuksi. T\u00e4t\u00e4 ei miss\u00e4\u00e4n vaiheessa ole korjattu ja <br />\nsyntym\u00e4aika on sen j\u00e4lkeen jatkuvasti v\u00e4\u00e4rin.\n</p>\n<p>\nSamoin toinen etunimi putoaa pois ja Edla Gustavasta tulee Edla.\n</p>\n</div>\n</div>",
